// File contracts_orig/governance/WaveBar.sol



pragma solidity 0.8.7;



contract WaveBar is ERC20("Voting Escrowed Wave", "veWAVE") {
    using SafeERC20 for IERC20;

    IERC20 public vestingToken;

    event Enter(
        address indexed user,
        uint256 vestingInAmount,
        uint256 mintedAmount
    );
    event Leave(
        address indexed user,
        uint256 vestingOutAmount,
        uint256 burnedAmount
    );
    event ShareRevenue(uint256 amount);

    constructor(IERC20 _vestingToken) {
        vestingToken = _vestingToken;
    }

    function enter(uint256 _amount) external {
        if (_amount > 0) {
            uint256 totalLockedTokenSupply = vestingToken.balanceOf(
                address(this)
            );

            uint256 totalveWave = totalSupply();

            vestingToken.transferFrom(msg.sender, address(this), _amount);
            uint256 mintAmount;
            // If no fWave exists, mint it 1:1 to the amount put in
            if (totalveWave == 0 || totalLockedTokenSupply == 0) {
                mintAmount = _amount;
            }
            // Calculate and mint the amount of fWave the blp is worth. The ratio will change overtime
            else {
                uint256 shareOfveWave = (_amount * totalveWave) /
                    totalLockedTokenSupply;

                mintAmount = shareOfveWave;
            }
            _mint(msg.sender, mintAmount);
            emit Enter(msg.sender, _amount, mintAmount);
        }
    }

    function leave(uint256 _shareOfveWave) external {
        if (_shareOfveWave > 0) {
            uint256 totalVestedTokenSupply = vestingToken.balanceOf(
                address(this)
            );
            uint256 totalveWave = totalSupply();
            // Calculates the amount of vestingToken the fWave are worth
            uint256 amount = (_shareOfveWave * totalVestedTokenSupply) /
                totalveWave;
            _burn(msg.sender, _shareOfveWave);
            vestingToken.transfer(msg.sender, amount);

            emit Leave(msg.sender, amount, _shareOfveWave);
        }
    }

    function shareRevenue(uint256 _amount) external {
        vestingToken.transferFrom(msg.sender, address(this), _amount);
        emit ShareRevenue(_amount);
    }
}

